import React from 'react';



type InputType = {
    value: number
    onChange: (e: number) => void

}

export const Input = (props: InputType) => {

    return (
        <>
            <input value={props.value} onChange={(e) => props.onChange(+e.currentTarget.value)}
                    type='number' />
        </>
    );
};
